define(["./database-module"],function(){describe("database Store",function(){var e;beforeEach(module("database")),beforeEach(inject(function(t){e=new t})),it("should instantiate a store object",function(){expect(e.store).toEqual({})}),it("should support creating a collection",inject(function(t){e.create("nameSpace"),expect(e.store.nameSpace).toEqual(jasmine.any(t)),expect(e.store.nameSpace.length).toBe(0)})),it("should throw an error if trying to recreate an existing nameSpace",function(){e.create("nameSpace"),expect(function(){e.create("nameSpace")}).toThrow()}),it("should support read",function(){e.store={nameSpace:"content"},expect(e.read("nameSpace")).toBe("content")}),it("should throw an error if trying to read a non existing nameSpace",function(){expect(function(){e.read("nameSpace")}).toThrow()}),it("should support update (with both object and array notations)",inject(function(t){var n=new t;e.store={nameSpace:n},e.update("nameSpace",1),expect(n.length).toBe(1),expect(n.at(0)).toBe(1),e.update("nameSpace",[2,3]),expect(n.length).toBe(3),expect(n.at(2)).toBe(3)})),it("should support del",function(){e.store={nameSpace:[]},e.del("nameSpace"),expect(e.store.nameSpace).toBeFalsy()})})});